import React, { useState } from 'react';
import Eac1 from './eac1.png';
import Eac4 from './Eac4.png';
import Image from 'react-bootstrap/Image';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/esm/Row';
import Col from 'react-bootstrap/esm/Col';

const MyForm = () => {
  // Define state variables for form fields
  const [formData, setFormData] = useState({
    Name: 'name',
    Email: 'email',
    Phone: 'phone',
    Address:'address'
  });

  // Handle form field changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();
    // Do something with the form data (e.g., send it to a server)
    console.log('Form data submitted:', formData);
  };

  return (
  <Container fluid  id="contact" className='pt-5' >
     Image src={Eac4}width={'100%'} height={100}/>
      <Row className='bg-white'>
      <Col pb-2>
        <Image src={Eac1} width={'100%'} height={450} />
      </Col>
      <Col className='bg-white pt-5'>
    <form onSubmit={handleSubmit}>
      <label className='pt-3'>
        First Name:
        <input
          type="text"
          name="Name"
          value={formData.Name}
          onChange={handleChange}
        />
      </label>
      <br />

      <label className='pt-3'>
        Last Name:
        <input
          type="text"
          name="Phone"
          value={formData.Phone}
          onChange={handleChange}
        />
      </label>
      <br />

      <label className='pt-3'>
        Email:
        <input
          type="email"
          name="Email"
          value={formData.Email}
          onChange={handleChange}
        />
      </label>
      <br />
      <label className='pt-3 pb-3'>
        Address:
        <input
          type="text"
          name="Address"
          value={formData.Address}
          onChange={handleChange}
        />
      </label>
      <br />
      <button  type="submit">Submit</button>
    </form>
    </Col>
    </Row>
    </Container>
  );
};

export default MyForm;
